class CJKwithBopomofo(ReporterPlugin):

	@objc.python_method
	def settings(self):
		self.menuName = Glyphs.localize({
			"en": u"CJK Pronunciation: Bopomofo/Zhuyin",
			"zh": u"",
			"zh-Hant": u"",
			"zh-Hans": u"",
			"ja": u"",
			})

	@objc.python_method
	def drawNodeCount( self, Layer ):
		glyph = Layer.parent
		glyphUnicode = glyph.unicode

		xHeight = Layer.master.xHeight
		angle = Layer.master.italicAngle
		descender = Layer.master.descender

		coordY = min(0, descender - 80)
		coordX = 0

		numsIndicator = list("")

		displayString = ""
		bopomofos = []

		if glyphUnicode in dictData:
			# print(glyphUnicode, ":", dictData[glyphUnicode])
			bopomofos = dictData[glyphUnicode]
		
		if len(bopomofos) > 1:
			for idx, bopomofo in enumerate(bopomofos):
				displayString += f"{numsIndicator[idx]} {bopomofo}  "
				# displayString += "\n"
		elif len(bopomofos) == 1 :
			displayString = bopomofos[0]
		
		self.drawTextAtPoint( displayString, NSPoint(coordX, coordY), align = "left", fontColor = NSColor.colorWithString_("#2E5C6E"), fontSize = 15 )

	@objc.python_method
	def background(self, layer):
		if self.getScale() >= 0.2:
			self.drawNodeCount( layer )
	
